import axios from 'axios';
import React, {useState, useEffect} from 'react'
import { Table } from 'react-bootstrap'
import ProgressBar from 'react-bootstrap/ProgressBar';
import {useLocation} from 'react-router-dom';
import './user_detail.css'
function User_detail() {
    const location = useLocation();
    const [state, setState] = useState({
        "users" : []
    });

    useEffect(() => {
        axios.get('http://localhost:8000/tracenet_user/')
        .then((customers) => {
            this.setState({ users: customers });
        }
              )

    }, [state])
    // const handleLoad = (e) => {
    //     axios.get('http://localhost:8000/tracenet_user/')
    //     .then((customers) => {
    //         this.setState({ users: customers });
    //     }
    //           )
    // }

    return (
        <div className="content-wrapper">

                <Table striped bordered hover ons>
                    <thead>
                        <tr>
                            <th>User_id</th>
                            <th>Username</th>
                            <th className='table_head'>Password</th>
                            <th>Active Status</th>
                            <th>Created at</th>
                            <th>Updated At</th>
                        </tr>
                    </thead>
                    <tbody>
                        this.state.users
                        <tr>
                            <td>{location.state.id}</td>
                            <td >{location.state.tracenet_username}</td>
                            <td className='table_data' >{location.state.tracenet_password}</td>
                            <td>Farmer_Registration.xlsx</td>
                            <td>ODMKXL</td>
                            <td>23/01/2023 12:48:38 PM</td>

                        </tr>

                    </tbody>
                </Table>




            </div>

    )
}

export default User_detail
